import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { MantineProvider, createTheme } from "@mantine/core";
import "@mantine/core/styles.css";
import AppShellDemo from "./views/components/AppShellDemo";
import Header from "./views/components/Header";
import AppBar from "./views/components/Global/AppBar";
import Navbar from "./views/components/Global/Navbar";
import Drawer from "./views/components/Global/Drawer";
import SideAppBar from "./views/components/Global/SideAppBar";
import Layout from "./views/components/Drawer/Layout";
import Layout2 from "./views/components/Drawer/Layout2";

const theme = createTheme({
  fontFamily: "Open Sans, sans-serif",
  primaryColor: "cyan",
});

function App() {
  return (
    <MantineProvider theme={theme}>
      <Router>
      <Switch>
        <Route path="/layout2" component={Layout2} />
        <Route path="/" component={Layout} />
      </Switch>
        <AppShellDemo />
        {/* <Header /> */}
        <Routes>
          {/* <Route path="/app-bar" element={<AppBar />} />
          <Route path="/nav-bar" element={<Navbar />} />
          <Route path="/drawer" element={<Drawer />} /> */}
          {/* <Route path="/side-bar" element={<SideAppBar />} /> */}
        </Routes>
      </Router>
    </MantineProvider>
  );
}

export default App;
